import { Fragment } from "react";
import Header from "../components/Header";
import MegaMenu from "../components/MegaMenu";


const Layout1 = (props) => {
    return (
       <Fragment>
            <Header/>
            <MegaMenu/>
            {props.children}
        </Fragment>
    )
}

export default Layout1;
